import React from 'react';
import './Setting.css';

const Setting = () => {
  return (
    <div className="setting-container">
      <form className="setting-form">
        <div className="setting-field">
          <label className="setting-label">Name</label>
          <input className="setting-input" type="text" placeholder="Rahul Singh" />
        </div>
        <div className="setting-field">
          <label className="setting-label">Email id</label>
          <input className="setting-input" type="email" placeholder="rahulsingh@gmail.com" />
        </div>
        <div className="setting-field">
          <label className="setting-label">Mobile no.</label>
          <input className="setting-input" type="text" placeholder="1234567890" />
        </div>
        <button type="button" className="save-button">Save Changes</button>
      </form>
      <div className='delete-button-part'>
        <button type="button" className="delete-button">Delete Account</button>
      </div>
    </div>
  );
};

export default Setting;
